import Header from './Header/Header';
import Login from './Login/Login';
import Footer from './Footer/Footer';

function App() {
  return (
    <div className="App">
      <Header />
      <main className="App-body">
        <p>Login to access the full dashboard</p>
        <Login />
      </main>
      <Footer />
    </div>
  );
}

export default App;
